import React from "react";
import "../assets/styles/HomePageStyles.css";
import { useSpring, animated } from "react-spring";

function HomePage() {
  const style1 = useSpring({
    from: { x: -200 },
    to: { x: 200 },
    config: { duration: 1000 },
  });

  const style2 = useSpring({
    from: { x: 0 },
    to: { x: 10 },
    config: { duration: 1200 },
  });

  const style3 = useSpring({
    from: { x: 0 },
    to: { x: 200 },
    config: { duration: 1400 },
  });

  const style4 = useSpring({
    from: { x: 0 },
    to: { x: 200 },
    config: { duration: 1600 },
  });

  return (
    <div>
      <div className="main-style">
        <animated.div style={style1}>
          <h1 className="first-row">Hello Friends</h1>
        </animated.div>
        <animated.div style={style2}>
          <h1 className="second-row">My Name Is Orald</h1>
        </animated.div>
        <animated.div style={style3}>
          <h1 className="third-row">I Am Web Developer</h1>
        </animated.div>
        <animated.div style={style4}>
          <h1 className="forth-row">Main Frameworks are REACT And DJANGO</h1>
        </animated.div>
      </div>
    </div>
  );
}

export default HomePage;
